import React  from 'react';
import Slider from 'react-slick';
import styled from 'styled-components';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import { menueProductData } from '../Data/ProductMenueSlider';
import { Button } from './Button';

const ProductSliderContainer1 =styled.div`
 /* max-width:100%;
max-height: 200vh;
background-color: royalblue;
padding-top: 20%; */
`;
const CardWrapper=styled.div`
 /* margin-left: 10%;
    margin-top: 18%;  */
`;
const ButtonWrapper=styled.div``;

function TestingCards() {
    var settings = {
        dot           : true,
        infinite      : true,
        speed         : 500,
        slidesToShow  : 3,
        slidesToScroll: 1,
        cssEase       : "linear"
    }
    return (
        <Slider {...settings}>
           <ProductSliderContainer1>
            <div className = "container">
            <div className = "row">
                <div className = "col-sm">
                    {menueProductData.map((items,index) =>(
                         <CardWrapper to = {items.Link} key ={index}>
                         <div class = "card" style = {{width: '18rem'}}>
                                 <img src       = {items.image} class         = "card-img-top" alt = "" />
                                     <div class     = "card-body">
                                         <h5  class     = "card-title">{items.cardTitle}</h5>
                                         <p   class     = "card-text">{items.cardText}</p>
                                         <h2>Range {items.rangePrice} Rs/</h2>
                                         <ButtonWrapper>
                                         <Button to = '/orderNow' primary = 'true'>Order Now</Button>
                                         </ButtonWrapper>
                                     </div>
                             </div>
                         </CardWrapper>
                    ))}
                </div>
            </div>
        </div>
        </ProductSliderContainer1>
        </Slider>
    )
}
export default TestingCards
